                <p>Pontos: 0</p>
                <p>Vidas: 3 ❤️</p>
            </div>
            <div className="pergunta">
                <h2>Aqui vai a pergunta...</h2>
                <p>Dica extra...</p>
            </div>
            <div className="opcoes">
                <button>Opção A</button>
                <button>Opção B</button>
                <button>Opção C</button>
                <button>Opção D</button>
            </div>
        </div>
    );
}

export default Jogo;
